import React from 'react'



const Home = () => {
  return (
    <div>
<div style={{
      position: "relative",
      height: "600px",
      backgroundImage: `data:image/jpeg;base64,`,
      backgroundSize: "cover",
      backgroundPosition: "center",
      color: "white",
      display: "flex",
      flexDirection: "column",
      justifyContent: "center",
      alignItems: "center",
      textAlign: "center",
      padding: "0 20px",
      fontFamily: "'Segoe UI', Tahoma, Geneva, Verdana, sans-serif",
    }}>
      <h1 style={{ fontWeight: "700", fontSize: "3rem", textShadow: "2px 2px 6px rgba(0,0,0,0.7)" }}>
        Bienvenue dans notre bijouterie
      </h1>
      <p style={{ fontSize: "1.5rem", marginTop: "10px", textShadow: "1px 1px 4px rgba(0,0,0,0.7)" }}>
        Élégance. Brillance. Éternité.
      </p>
      <button
        style={{
          marginTop: "25px",
          padding: "12px 30px",
          fontSize: "1rem",
          fontWeight: "600",
          borderRadius: "30px",
          border: "none",
          cursor: "pointer",
          backgroundColor: "rgba(255, 255, 255, 0.85)",
          color: "#333",
          boxShadow: "0 4px 8px rgba(0,0,0,0.3)"
        }}
        onClick={() => {
          // You can replace this with navigation code to your products page
          window.location.href = "/products";
        }}
      >
        Voir nos produits
      </button>
    </div>
      </div>
    )
  }

      export default Home
